import React from "react";

const Home = () => {
  return (
    <section id="header" className="">
      <div className="container-fluid nav bg">
        <div className="row">
          <div className="col-10 mx-auto">
            <div className="col-md-6 pt-5 pt-lg-0 order-2 order-lg-1">
              <h1>
                Hello, My name is
                <strong className="brand-name"> Maah Asghar</strong>
              </h1>

              <h2 className="my-3">
                I am a Software Dveloper, based in London, Ontario, Canada
              </h2>

              <div className="mt-3">
                <a className="btn-get-started">Get Started!</a>
              </div>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Home;
